            let a = anime.timeline(
                loop: true
            );

            a.add(
                targets : '.PwdFound .word',
                scale: [14,1],
                opacity: [0,1],
                easing: "easeOutCirc",
                duration: 800,
                delay: (el, i) => 800 * i
            ).add(
                targets: '.PwdFound',
                opacity: 0,
                duration: 1000,
                easing: "easeOutExpo",
                delay: 1000
            );    
            </script>
            <p>The result is : </p>
            {pwd}
        </header>
        </div>
    );
}

export default Result;
